const Toolbar = ({ searchfield, searchChange }) => {
  return (
    <div id='toolbar'>
      <div className='pa2'>
        <h3>Show filter:</h3>
      </div>
      <div className='pa2'>
        <input 
            className='pa3 ba b--green bg-lightest-blue'
            type='search' 
            placeholder='search users' 
            onChange={searchChange}
        />
    </div>
    </div>
  );
}

export default Toolbar;
